import './App.css';
import { useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState({});

  useEffect(() => {
    fetch("/login")
      .then((res) => res.json())
      .then((data) => setData(data.username, data.password));
  }, []);

  console.log(data);

  return (
    <div className="App">
      <header className="App-header">
        <p>{!data ? "Loading..." : data}</p>
      </header>
    </div>
  );
}

export default App;
